// SPDX-License-Identifier: MIT

pragma solidity  >=0.8.10;


contract Auction{

    mapping(address=>uint256) public bidders;
    address highestBidder;
    uint256 highestAmount;
    uint public EndingTime;
    address payable auctionSetter;

    event WonAuction(address winner, uint256 amount);
    event BidIncreased(address bidder, uint256 amount);
    event AuctionEnded(address winner, uint256 amount,uint EndingTime);


    constructor(
        uint time,
        address payable beneficiary
    ){
        beneficiary = auctionSetter;
        time = EndingTime;
    }


    function bid() public payable{
        if(block.timestamp> EndingTime){
            emit AuctionEnded(highestBidder, highestAmount, EndingTime);
        }
        if(msg.value> highestAmount){
            highestBidder = msg.sender;
            highestAmount = msg.value;
            emit BidIncreased(highestBidder, highestAmount);
        }
    }
    function endAuction() external{
        if(block.timestamp < EndingTime){
            auctionSetter.transfer(highestAmount);
            emit AuctionEnded(highestBidder, highestAmount, EndingTime);
        }




    }


}
